import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import Navbar from "./Navbar";
import Footer from "./Footer";
import Cards from "./CardRender";
import Data from "./Cards_data";



function Home() {
  return (
  <>
      <Navbar />
      
      
      <Cards 
        imgsrc={Data[0].imgsrc}
        name={Data[0].name}
        role={Data[0].role}
        link={Data[0].link}

      />
      <Cards 
        imgsrc={Data[1].imgsrc}
        name={Data[1].name}
        role={Data[1].role}
        link={Data[1].link}
      />
      <Cards 
        imgsrc={Data[2].imgsrc}
        name={Data[2].name}
        role={Data[2].role}
        link={Data[2].link}
      />
      <Footer />
  </>
  );
}

export default Home;
